import React from 'react';
import {Header, Icon } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Segment>
                
            </Segment>
            <div as='h2' icon textAlign='center'>
                <video autoPlay loop muted
                style={{
                    position: "absolute",
                    width : "100%",
                    top:"0%",
                    left:"50%",
                    objectFit :"cover",
                    transform : "translate(-50%,-10%)"
                    //zIndex: "-1"
                }}
                >
                    <source src={Vikings} type="video/mp4"/>
                </video>
               
            </div>
        </React.Fragment>
    )
}

